We have a Tooltip component that is used in different parts of the application. The Tooltip component is a child of a parent component that is not related to the other parent components.

The problem is that when we open a Tooltip, it should close the previously opened Tooltip. Since the Tooltip component is isolated from each other, we can't access the state of the other Tooltip component.

## The Solution

To solve this problem, we can use React Context to share the state of the Tooltip component among all the Tooltip components in the application.

Here's how we can do it:

1. Create a new file called `TooltipContext.js` and define the context:

```javascript
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```

2. Create a new file called `TooltipProvider.js` and define the provider component:

```javascript
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

3. Wrap the entire application with the `TooltipProvider` component:

```javascript
import React from 'react';
import TooltipProvider from './TooltipProvider';

const MyApp = ({ Component, pageProps }) => {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
};

export default MyApp;
```

4. Modify the `Tooltip` component to use the `TooltipContext`:

```javascript
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    if (activeTooltip !== id) {
      openTooltip(id);
    }
  };

  const handleMouseLeave = () => {
    if (activeTooltip === id) {
      closeTooltip();
    }
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      style={{ position: 'relative' }}
    >
      {children}
      {activeTooltip === id && (
        <div style={{ position: 'absolute', top: '100%', left: '0', background: 'white', padding: '5px', border: '1px solid black' }}>
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

Now, when we use the `Tooltip` component, it will share the state with all the other `Tooltip` components in the application. When we open a Tooltip, it will close the previously opened Tooltip.

## Conclusion

In this article, we learned how to create a Tooltip component in NextJS using React Context to close the previously opened Tooltip and so on. By using React Context, we were able to share the state of the Tooltip component among all the Tooltip components in the application. This allowed us to close the previously opened Tooltip when a new Tooltip is opened.
